import {
	Button,
	Modal,
	ModalBody,
	ModalContent,
	ModalFooter,
	ModalHeader,
	ModalOverlay,
	useDisclosure,
} from "@chakra-ui/react";
import React from "react";

const Habits = () => {
	const { isOpen, onOpen, onClose } = useDisclosure();

	return (
		<>
			<Button onClick={onOpen}>Add Habit</Button>
			<Modal>
				<ModalOverlay />
				<ModalContent>
					<ModalHeader>Title</ModalHeader>
					<ModalBody>Hello</ModalBody>
					<ModalFooter>
						<Button colorScheme="blackAlpha"></Button>
					</ModalFooter>
				</ModalContent>
			</Modal>
		</>
	);
};

export default Habits;
